class Session {
    constructor() {
        this.passes = {
                "3": 0,
                "2": 0,
                "1": 0,
                "0": 0,
            }
        this.count = 0;
        this.total = 0;
        this.average = 0;
      }

    incrementPass(passKey){
        this.passes[passKey] =  this.passes[passKey] + 1;
        this.count += 1;
        this.total += passKey;
        this.average = this.total / this.count
    }
}
export default Session;
